import React from 'react'
import SearchBar from './searchBar/SearchBar'
const App = () => {
    return (
        <div>
            <SearchBar searchedList={[
    "tooth paste",
    "tooth brush",
    "mouth wash",
    "dental floss",
    "mouth guard",
]}/>
        </div>
    )
}

export default App
